    async function ConvertRichTextToMarkdown(rt) {
      await rt.detectFacets(agent);
      let markdown = "";
      for (const segment of rt.segments()) {
        if (segment.isLink()) {
          markdown += `[${segment.text}](${segment.link?.uri})`;
        } else if (segment.isMention()) {
          markdown += `[${segment.text}](https://bsky.app/profile/${segment.mention?.did})`;
        } else {
          markdown += segment.text;
        }
      }
      return markdown;
    }
    async function GetBskyList(uri, cursorArg = "", limit = 6, pagination) {
      let response;
      if (!pagination) {
        response = await agent.app.bsky.graph.getList({
          list: uri,
          limit,
          cursor: cursorArg
        });
      } else {
        let cursor = cursorArg;
        let members = [];
        do {
          const res = await agent.app.bsky.graph.getList({
            list: uri,
            limit,
            cursor
          });
          cursor = res.data.cursor;
          members = members.concat(res.data.items);
        } while (cursor);
        response = members;
      }
      return response;
    }
